# [MUSIC MODULE]
# Creating genres table
CREATE TABLE IF NOT EXISTS genres (
	genre_id INT PRIMARY KEY AUTO_INCREMENT,
	name VARCHAR(50) NOT NULL,
	description VARCHAR(255)
);

# Creating users table
CREATE TABLE IF NOT EXISTS users (
	user_id INT PRIMARY KEY AUTO_INCREMENT,
	username VARCHAR(50) NOT NULL,
	email VARCHAR(255) NOT NULL UNIQUE,
	phone VARCHAR(50) DEFAULT NULL,
	password VARCHAR(255) NOT NULL,
	date_of_birth DATE NOT NULL,
	country CHAR(2),
	subscription_type VARCHAR(20) NOT NULL,
	profile_image VARCHAR(255) DEFAULT NULL,
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);

# Creating artists table
CREATE TABLE IF NOT EXISTS artists (
	artist_id INT PRIMARY KEY AUTO_INCREMENT,
	name VARCHAR(50) NOT NULL,
	bio TEXT,
	country VARCHAR(3),
	date_of_birth DATE NOT NULL,
	genre_id INT,
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    CONSTRAINT fk_genre FOREIGN KEY (genre_id) REFERENCES genres(genre_id)
);

# Creating albums table
CREATE TABLE IF NOT EXISTS albums (
	album_id INT PRIMARY KEY AUTO_INCREMENT,
	title VARCHAR(255) NOT NULL,
	release_date DATE NOT NULL,
	type ENUM('album', 'single', 'compilation'),
	image VARCHAR(255) DEFAULT NULL,
	genre_id INT NOT NULL,
	artist_id INT NOT NULL, 
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	CONSTRAINT fk_genre_album FOREIGN KEY (genre_id) REFERENCES genres(genre_id),
	CONSTRAINT fk_artist_album FOREIGN KEY (artist_id) REFERENCES artists(artist_id)
);

# Creating songs table
CREATE TABLE IF NOT EXISTS songs (
	song_id INT PRIMARY KEY AUTO_INCREMENT,
	title VARCHAR(255) NOT NULL,
	duration INT NOT NULL,
	artist_id INT NOT NULL,
	genre_id INT NOT NULL,
	album_id INT,
	credit JSON DEFAULT ('{"performed_by": "", "written_by": [], "produced_by": [], "source": ""}') CHECK (JSON_VALID(credit)),
	streams INT DEFAULT 0,
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    CONSTRAINT fk_artist_song FOREIGN KEY (artist_id) REFERENCES artists(artist_id),
    CONSTRAINT fk_genre_song FOREIGN KEY (genre_id) REFERENCES genres(genre_id),
    CONSTRAINT fk_album_song FOREIGN KEY (album_id) REFERENCES albums(album_id)
);

# Creating derivated table artists_followers
CREATE TABLE IF NOT EXISTS artists_followers (
	user_id INT,
	artist_id INT,
	followed_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    PRIMARY KEY (user_id, artist_id),
    CONSTRAINT fk_user_follower FOREIGN KEY (user_id) REFERENCES users(user_id),
    CONSTRAINT fk_artist_follower FOREIGN KEY (artist_id) REFERENCES artists(artist_id)
);

# Creating liked_songs table
CREATE TABLE IF NOT EXISTS liked_songs (
	user_id INT NOT NULL,
	song_id INT NOT NULL,
	liked_at DATETIME DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY (user_id, song_id),
	CONSTRAINT fk_user_liked FOREIGN KEY (user_id) REFERENCES users(user_id),
	CONSTRAINT fk_song_liked FOREIGN KEY (song_id) REFERENCES songs(song_id)
);

# Creating playlists table
CREATE TABLE IF NOT EXISTS playlists (
	playlist_id INT PRIMARY KEY AUTO_INCREMENT,
	name VARCHAR(50) NOT NULL,
	user_id INT NOT NULL,
	visibility ENUM('public', 'private') NOT NULL DEFAULT 'public',
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    CONSTRAINT fk_user FOREIGN KEY (user_id) REFERENCES users(user_id)
);

# Creating playlist_songs table
CREATE TABLE IF NOT EXISTS playlist_songs (
    playlist_id INT NOT NULL,
    song_id INT NOT NULL,
    added_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    PRIMARY KEY (playlist_id, song_id),
    CONSTRAINT fk_playlist_songs_playlist FOREIGN KEY (playlist_id) REFERENCES playlists(playlist_id),
    CONSTRAINT fk_playlist_songs_song FOREIGN KEY (song_id) REFERENCES songs(song_id)
);

# [Payment System]

# Creating Plans
CREATE TABLE IF NOT EXISTS plans (
	plan_id INT PRIMARY KEY AUTO_INCREMENT,
	plan VARCHAR(30) NOT NULL,
	description VARCHAR(255),
	max_member TINYINT UNSIGNED NOT NULL,
	price DECIMAL(4, 2) NOT NULL
);

# Creating Subscriptions
CREATE TABLE IF NOT EXISTS subscriptions (
	sub_id INT PRIMARY KEY AUTO_INCREMENT,
	date_start DATE NOT NULL,
	date_finish DATE,
	recorrency BOOL NOT NULL,
	status ENUM('active', 'disabled') NOT NULL,
	plan_id INT,
	CONSTRAINT fk_sub_plan FOREIGN KEY (plan_id) REFERENCES plans(plan_id)
);

# Creating Table Member - Subscription
CREATE TABLE IF NOT EXISTS member_subscription (
	user_id INT NOT NULL,
	sub_id INT NOT NULL,
	role ENUM('owner', 'member'),
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    PRIMARY KEY (user_id, sub_id),
    CONSTRAINT fk_ms_user FOREIGN KEY (user_id) REFERENCES users(user_id),
    CONSTRAINT fk_ms_sub FOREIGN KEY (sub_id) REFERENCES subscriptions(sub_id)
);

CREATE TABLE IF NOT EXISTS payment_methods (
	method_id INT PRIMARY KEY AUTO_INCREMENT,
	user_id INT NOT NULL,
	method_type ENUM('credit_card', 'google_pay') NOT NULL,
	card_brand VARCHAR(25) NOT NULL,
	card_last4 VARCHAR(4) DEFAULT NULL,
	expiry_date DATE DEFAULT NULL,
	token VARCHAR(100) NOT NULL, 
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	CONSTRAINT fk_pm_user FOREIGN KEY (user_id) REFERENCES users(user_id)
);

CREATE TABLE IF NOT EXISTS orders (
	order_id INT PRIMARY KEY AUTO_INCREMENT,
	user_id INT,
	plan_id INT,
	method_id INT,
	amount DECIMAL(4, 2) NOT NULL,
	status ENUM('pending', 'completed', 'failed', 'refunded') NOT NULL,
	transaction_id VARCHAR(100) UNIQUE NOT NULL,
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	CONSTRAINT fk_orders_user FOREIGN KEY (user_id) REFERENCES users(user_id),
    CONSTRAINT fk_orders_plans FOREIGN KEY (plan_id) REFERENCES plans(plan_id),
    CONSTRAINT fk_orders_payment_method FOREIGN KEY (method_id) REFERENCES payment_methods(method_id)
);


